import React from "react";
import * as S from './App.styles'
import 'primeicons/primeicons.css';
import { useState } from "react";

const Login = () => {

    const[nome, setNome] = useState('');
    const[senha, setSenha] = useState('');

    const handleChange = (event) =>{
        setSenha(event.target.value);
        setNome(event.target.value)
    }

    const handleClick = () => {
        console.log(senha + nome)
    }

    return(
        <div className="container">
                <S.HeaderLogin>
                    <S.Title>Iphones do Nairobi</S.Title>
                    <S.Subtitle>
                        <i className="pi pi-lock" style={{ color: 'white',  fontSize: '2.0rem'  }}></i>
                        100% Seguro
                    </S.Subtitle>
                </S.HeaderLogin>
            <S.FormsLogin>    
                <i className="pi pi-envelope"></i>           
                <input type="text" value={nome} onChange={handleChange} placeholder="Digite seu e-mail"></input>
                <i className="pi pi-key"></i>
                <input type="password" value={senha} onChange={handleChange} id="senha" placeholder="Digite sua senha"></input>
                <button onClick={handleClick}>Entrar</button>
            </S.FormsLogin>
        </div>
    )
}

export default Login
